$modalPumpDesc_9 = '<p class="burners-modal-info__content-right_description main-desc">Busch R 5 это масляный пластинчато-роторный вакуумный насос. Надежность данных насосов обусловлена высококэффективными элементами и экономичным режимом смазывания. Особым отличием насоса модели R 5 является. Пластинчато-роторные насосы Буш R 5, стали известны благодаря своей способности к современной и энергосберегающей генерации вакуума для самой широкой области применения. Насос надежно справляется как с перерывами, так и с беспрерывной эксплуатацией. Прочность R 5 достигается на за счет технологии рециркуляционной смазки маслом, что гарантирует высокий уровень вакуума, справляющийся даже с самыми высокими нагрузками.  Насос также можно оснастить газобалластным клапаном (не входит в комплект поставки), при помощи которой пары можно перекачивать без конденсации.</p>';
