$modalPump_2_Desc_13 = '<p class="burners-modal-info__content-right_description main-desc">Busch MINK это сухие кулачковые вакуумные насосы и компрессоры. Предельное давление такого насоса составляется 20-200 мбар, избыточное давление 2 бар. Насос MINK специально разработан для промышленного производства. Насос поддерживает постоянный вакуум, высокую скорость перекачки, а также полностью безмаслянное сжатие. Для эксплуатации насоса не требуется дополнительных контактов, во время сжатия не требуется ни масло, ни жидкостей.<br><br> 
