$modalPump_2_Desc_17 = '<p class="burners-modal-info__content-right_description main-desc">Busch MINK это сухие кулачковые вакуумные насосы и компрессоры. Предельное давление такого насоса составляется 20-200 мбар, избыточное давление 2 бар. Насос MINK специально разработан для промышленного производства. Насос поддерживает постоянный вакуум, высокую скорость перекачки, а также полностью безмаслянное сжатие. Для эксплуатации насоса не требуется дополнительных контактов, во время сжатия не требуется ни масло, ни жидкостей.<br><br> 
Передовая технология изготовления позволит достичь максимально уровня эффективности, что приводит к снижению потребления энергии в совокупности с увеличением производительности. Благодаря бесконтактной среде, обслуживание данной модели практически не требует, что приводит к снижению эксплуатационных затрат на 60%. Насос обеспечивает давление в до 2 бар, при объемных потоках 580 м3/ч.</p>';
