$modalPump_3_Desc_7 = '<p class="burners-modal-info__content-right_description main-desc">Busch COBRA  NC, NX, Это сухой винтовой вакуумный насос для промышленного применение при извлечении незагрязненных газов и паров. Предельное остаточное давление: 0,01 - 1 hPa (mbar). Моджель оснащена ассиметричным профилем винта, а также выходом свободного газа, что обеспечивает максимальную степень эффективности, совместимости, жидкости и частиц. Кроме того, модель равномерно распределяет температуру, что обеспечивает оптимальную коррозийную стойкость. Некоторые модели сертифицированы по директиве ATEX. </p>';
