$modalPump_3_Desc_12 = '<p class="burners-modal-info__content-right_description main-desc"> Busch COBRA DS, BA, BC это эффективный безмасляный винтовой вакуумный насос обычно используется в таких сложных процессах, как работа с полупроводниками, солнечными модулями, также при производстве плоских экранов, а также в промышленных областях нанесения покрытия. Предельное остаточное давление: 0,001 - 0,03 мбар. Винтовые вакуумные насосы COBRA Semicon, оборудованные высокоэффективными двигателями, имеют огромные потенциалы энергосбережения. Простая конструкция включает испытанные винтовые профили Busch (по выбору может быть установлен дополнительный насос Рутса прямо на фланец), что делает насосы COBRA Semicon чрезвычайно мощными, надежными вакуумными генераторами, не требующими большого технического обслуживания. Эргономичный дизайн упростит установку, даже в ограниченном пространстве, обеспечивая высокую эффективность для своего класса, значительно упрощая установку даже в условиях ограниченного пространства. </p>';
