$modalPump_4_Desc_6 = '<p class="burners-modal-info__content-right_description main-desc">
 Busch PANDA/PUMA это бустерные безмасляные вакуумные насосы, которые используются совместно со вспомогательными насосами во многих областях где требуются большие объемы откачки. Бустерный насос работает в бесконтактном режиме и не требует уплотняющей жидкости в рабочей камере (масло или вода). Вакуумные усилители серии Panda оснащаются объодным клапаном. Типоряд предусматривает широкий ассортимент доступных размеров, объема откачки. Так что модель идеально подойдет под ваши условия работы.
</p>';
