$modalPump_5_Desc_7 = '<p class="burners-modal-info__content-right_description main-desc">Busch SECO - это сухой пластинчато-роторный вакуумный насос и компрессов. Модель чаще всего применяется для промышленного применения, где требуется быстрая и надежная подача вакуума. Отличительной особенностью данной модели является возможность работы без использования масла, благодаря особенностям конструкции. Кроме того, насос SECO оснащен износостойкими и самосмазывающимися графитовыми ротационными лопатками, а также смазкой подшипников, рассчитаную на весь срок службы насосов. Эргономичная конструкция позволит с легкостью выполнить установку в удобном для вас месте.</p>';
