$modalPump_6_Desc_1 = '<p class="burners-modal-info__content-right_description main-desc">Busch TYR это двухроторные воздуходувки, выступающие в роли вакуумных генераторов и генераторов избыточного давления. Яркий дисплей расположен на шумопоглощающем корпусе. С его опомощью можно котролировать рабочее давление, фильтр, а также уровень масла в редукторе. Типоряд TYR поставляется в шести различных типоразмерах, поэтому подбирается индивидуально под ваши задачи.</p>';
