$modalPump_7_Desc_18 = '<p class="burners-modal-info__content-right_description main-desc">Busch DOLPHIN Жидкостно-кольцевые вакуумные насосы и компрессоры. Поставляемые насосы могут быть как одноступенчатые, так и двухступенчатого типа и различных версий. Модульная конструкция плиты основания позволит произвести систему специально под заказ в соответствии со специальными процессами.</p>';
