$modalPump_8_Desc_9 = '<p class="burners-modal-info__content-right_description main-desc"> Busch SAMOS это вихревая воздуходувка использующаяся во всех областях, требующие вакуума использования без пульсации и давления. Конструкция модели предусматривает как горизонтальную, так и вертикальную установку. Воздуходувка изготовлена из штампованного алюминия. Смазанные специальным маслом герметизированные подшипники, не требуют тех.обслуживания во время всего срока эксплуатации. Насос оснащен внутренним глушителем для более тихой работы устройства.</p>';
$modalPump_8_UnderDesc_9 = "Двухступенчатый";
