$modalPump_9_Desc_1 = '<p class="burners-modal-info__content-right_description main-desc"> Busch Fossa это герметически-уплотненный безшумный насос с низким уровнем вибрации. Модель применяется для решения при перекачивании воздуха или транспортировки газа без протечки с окружающим воздухом. Busch Fossa предусматривает два типоразмера со скоростью перекачки 15 и 35 м3/ч соответственно при низком уровне шума и вибрации.  Насос укомплектован герметезированными подшипниками со смазкой на весь период эксплуатации устройства. Газобалластный вентиль позволяет перекачивать пары. 
</p>';
