$modalPump_10_Desc_1 = '<p class="burners-modal-info__content-right_description main-desc">Busch Rangu - диффузионный вакуумные насосы поставляемый в трех типоразмерах для использовании при высоких уровнях вакуума. Насос используется при высоких уровнях вакуума до 10-8 гПа (мбар). Кроме того, модель Rangu может использоваться практически для всех видов паров и газов. Насос работает практически бесшумно и без вибрации.</p>';
